import React, {useState, useEffect} from 'react';
import Button from '@material-ui/core/Button';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Link from '@material-ui/core/Link';
import { useSelector, useDispatch } from 'react-redux';
import Fab from '@material-ui/core/Fab';
import AddIcon from '@material-ui/icons/Add';
import Header from '../components/Header';
import {Actions} from '../actions';
import './ProductList.css';


const defaultImage = "data:image/png;base64,";


function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright © '}
      <Link color="inherit" href="https://material-ui.com/">
        www.doaquafishes.com
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const useStyles = makeStyles((theme) => ({
  icon: {
    marginRight: theme.spacing(2),
  },
  heroContent: {
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(8, 0, 6),
  },
  heroButtons: {
    marginTop: theme.spacing(4),
  },
  cardGrid: {
    paddingTop: theme.spacing(8),
    paddingBottom: theme.spacing(8),
  },
  card: {
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
  },
  cardMedia: {
    paddingTop: '56.25%', // 16:9
  },
  cardContent: {
    flexGrow: 1,
  },
  footer: {
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(6),
  },
}));

const cards = [1, 2, 3, 4, 5, 6, 7, 8, 9];

export default function ProductList() {
  const classes = useStyles();
  const dispatch = useDispatch();
  const productList = useSelector(state => state.list.list);

  useEffect(()=>{
    console.log("started");
    dispatch(Actions.list());
  },[]);

  const deleteItem=(item)=>{
    dispatch(Actions.deleteListItem(item));
  }

  return (
    <React.Fragment>
      <Header/>
      <main>
        <div className={classes.heroContent}>
          <Container maxWidth="sm">
            <Typography component="h1" variant="h2" align="center" color="textPrimary" gutterBottom>
              DO AQUA FISHES
            </Typography>
            <Typography variant="h5" align="center" color="textSecondary" paragraph>
             Wide variety of ornamental fishes which are very energetic, stunning, and healthy.
            </Typography>
          </Container>
        </div>
        <Container className={classes.cardGrid} maxWidth="md">
          <div className="">
            <Fab color="primary" aria-label="add">
              <AddIcon />
            </Fab>
          </div>
          {/* End hero unit */}
          <Grid container spacing={4}>
            {productList?.map((prod) => (
              <Grid item key={prod.prod_id} xs={12} sm={6} md={4}>
                <Card className={classes.prod}>
                  <CardMedia
                    className={classes.cardMedia}
                    image={prod?.image ? prod.image : defaultImage}
                    title="Image title"
                  />
                  <CardContent className={classes.cardContent}>
                    <Typography gutterBottom variant="h5" component="h2">
                      {prod?.name}
                    </Typography>
                    <Typography>
                      {prod.description}
                    </Typography>
                  </CardContent>
                  <CardActions>
                        <a href={`/products/${prod.prod_id}`}>
                      <Button size="small" variant="contained" color="primary">
                        Edit
                      </Button>
                        </a>
                      <Button onClick={()=> deleteItem(prod)} variant="contained" size="small" color="secondary">
                        Delete
                      </Button>
                  </CardActions>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </main>
      {/* Footer */}
      <footer className={classes.footer}>
        <Typography variant="h6" align="center" gutterBottom>
          Do Aqua Fishes
        </Typography>
        <Typography variant="subtitle1" align="center" color="textSecondary" component="p">
          Wide variety of ornamental fish collection!
        </Typography>
        <Copyright />
      </footer>
      {/* End footer */}
    </React.Fragment>
  );
}
